import React, { Component } from 'react';

class AddFishForm extends Component {
  render() {
    return (
      <form>
        <input name='name' />
        <input name='price' />
        <input name='status' />
        <input name='desc' />
        <input name='image' />
      </form>
    );
  }
}

export default AddFishForm;
